// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import {SafeMath} from '../dependencies/openzeppelin/contracts/utils/math/SafeMath.sol';


contract MakeTokenID {
    using SafeMath for uint256;

    uint8 constant ADDRESS_BITS = 160;
    uint8 constant INDEX_BITS = 56;
    uint8 constant SUPPLY_BITS = 40;

    uint256 constant SUPPLY_MASK = (uint256(1) << SUPPLY_BITS) - 1;
    uint256 constant INDEX_MASK = ((uint256(1) << INDEX_BITS) - 1) ^
        SUPPLY_MASK;

    uint256 public newID;

    function tokenMaxSupply(uint256 _id) public pure returns (uint256) {
        return _id & SUPPLY_MASK;
    }

    function tokenIndex(uint256 _id) public pure returns (uint256) {
        return _id & INDEX_MASK;
    }

    function tokenCreator(uint256 _id) public pure returns (address) {
        return address(uint160(_id >> (INDEX_BITS + SUPPLY_BITS)));
    }

    function makeID(address _creator, uint256 _index, uint256 _supply) public returns(uint256) {
        require(_index > 0, "index must > 0");
        require(_supply > 0, "supply must > 0");
        uint256 finalId = (uint256(uint160(_creator)) <<  (INDEX_BITS + SUPPLY_BITS)) | (uint256(_index) << SUPPLY_BITS)  | _supply ;
        newID =  finalId;
        return finalId;
    }

    function indexShift(uint256 index) public pure returns (uint256) {
        return index>>SUPPLY_BITS;
    }
}
